class Homemodal {
  Homemodal({
      this.status, 
      this.msg, 
      this.data, 
      this.liveCount,});

  Homemodal.fromJson(dynamic json) {
    status = json['status'];
    msg = json['msg'];
    if (json['data'] != null) {
      data = [];
      json['data'].forEach((v) {
        data?.add(Data.fromJson(v));
      });
    }
    liveCount = json['live_count'];
  }
  bool? status;
  String? msg;
  List<Data>? data;
  int? liveCount;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = status;
    map['msg'] = msg;
    if (data != null) {
      map['data'] = data?.map((v) => v.toJson()).toList();
    }
    map['live_count'] = liveCount;
    return map;
  }

}

